import React, {useContext} from 'react';
// import Drawer from '@mui/material/Drawer';
import AppBar from '@mui/material/AppBar';
import {Typography} from '@mui/material';
import Box from '@mui/material/Box';
// import List from '@mui/material/List';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
// import ListItem from '@mui/material/ListItem';
// import CloseIcon from '@mui/icons-material/Close';
// import Divider from '@mui/material/Divider';
import Toolbar from '@mui/material/Toolbar';
import SettingsIcon from '@mui/icons-material/Settings';
import Dropdown from 'muicss/lib/react/dropdown';
import DropdownItem from 'muicss/lib/react/dropdown-item';
import {ThemeStateContext} from './Contexts';
// const pages = ['Contact', 'Projects', 'Resume', 'Games'];
/**
 * Navbar Drawer creator
 * @return {object} JSX
 */
function CustomNavbar() {
  /* State to track if collapsed navbar open */
  const [collapsedIsOpen, setCollapsedIsOpen] = useState(false);
  /* State to track if settings is open */
  const [SettingsIsOpen, setSettingsIsOpen] = useState(false);
  const changeThemeState = useContext(ThemeStateContext);
  /* Use our given theme */
  return (
      <Box sx={{flexGrow: 1}}>
        <AppBar position="static"
        color = 'primary'>
          <Toolbar>
            <IconButton>
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" component="div" sx={{flexGrow: 1}}>
              News
            </Typography>
            <IconButton onClick = {() => changeThemeState('dark')}>
              <Dropdown>
                <SettingsIcon />
              </Dropdown>
            </IconButton>
          </Toolbar>
        </AppBar>
      </Box>
  );
};
export {CustomNavbar};
